import React from 'react';
import { AdminPageStyled } from './AdminPage.style';

const AdminPage = () => {
  useEffect(() => {
    if (!postId) {
      async function fetchMyAPI() {
        let response = await getRessources('post');
        setPosts(response);
      }
      fetchMyAPI();
    } else {
      async function fetchMyAPI() {
        let response = await getRessource('post', postId);
        setCurrentPost(response);
      }
      fetchMyAPI();
    }
  }, [postId]);

  return (
    <AdminPageStyled>
      Ma page admin ici
    </AdminPageStyled>
  );
};

export { AdminPage };
